import SwiftUI

class SearchEngine: Codable {
  var name: String
  var searchUrlString: String
  var favicon: String
  
  init(name: String, searchUrlString: String, favicon: String) {
    self.name = name
    self.searchUrlString = searchUrlString
    self.favicon = favicon
  }
}

